import Link from "next/link";

const LandingHeader = () => (
  <div className="landing">
    <div className="landing--wrapper">
      <h1>Woo Young Choi</h1>
      <p>Software engineer based in New York, NY.</p>
      <p>Specializing in building and designing websites and applications.</p>
    </div>
    <style jsx>
      {`
        .landing {
          color: #2699fb;
          height: 800px;
          display: flex;
          justify-content: center;
          flex-direction: column;
          align-items: center;
          min-height: 90vh;
          font-family: "Georgia, serif";
          text-align: center;
          margin: 0 auto;
          border: solid;
        }

        landing--wrapper {
          margin: auto;
        }

        h1 {
          font-size: 30px;
          font-weight: normal;
        }

        p {
          font-size: 15px;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
